import React, {useState} from 'react';

const Size = function () {

    return (
        <div>
            <p className="size" id="frameSize">
                Frame size: {1}
            </p>
            <div className="other-size">
                <p>Other size:</p>
                <div className="btnSize">
                    <button id="x3" className="xBtn" value="3x3" onClick={1}>3x3</button>
                    <button id="x4" className="xBtn" value="4x4" onClick={1}>4x4</button>
                    <button id="x5" className="xBtn" value="5x5" onClick={11}>5x5</button>
                    <button id="x6" className="xBtn" value="6x6" onClick={1}>6x6</button>
                    <button id="x7" className="xBtn" value="7x7" onClick={1}>7x7</button>
                    <button id="x8" className="xBtn" value="8x8" onClick={1}>8x8</button>
                </div>
            </div>
        </div>
    );
};


export default Size;
